// ==UserScript==
// @name         豆瓣：跳转至串流
// @namespace    http://tampermonkey.net/
// @version      0.25
// @description  在豆瓣专辑界面添加跳转至 Spotify，QQ音乐，网易云音乐的按钮
// @author       You
// @include      /^https?:\/\/music\.douban\.com\/subject\/[0-9]+\/[^\/]*$/
// @icon         https://www.google.com/s2/favicons?sz=64&domain=douban.com
// @grant        none
// @run-at       document-idle
// @downloadURL https://update.greasyfork.org/scripts/488234/%E8%B1%86%E7%93%A3%EF%BC%9A%E8%B7%B3%E8%BD%AC%E8%87%B3%E4%B8%B2%E6%B5%81.user.js
// @updateURL https://update.greasyfork.org/scripts/488234/%E8%B1%86%E7%93%A3%EF%BC%9A%E8%B7%B3%E8%BD%AC%E8%87%B3%E4%B8%B2%E6%B5%81.meta.js
// ==/UserScript==

const STREAM_SERVICES = {
  spotify: {
    name: "Spotify",
    searchUrl: "https://open.spotify.com/search/{{query}}/albums",
    iconSrc:
      "data:image/png;base64,",
  },
  qq: {
    name: "QQ 音乐",
    searchUrl: "https://y.qq.com/n/ryqq/search?w={{query}}&t=album",
    iconSrc:
      "data:image/x-icon;base64,",
  },
  netease: {
    name: "网易云音乐",
    searchUrl: "https://music.163.com/#/search/m/?s={{query}}&type=10",
    iconSrc:
      "data:image/x-icon;base64,",
  },
};
const streamDiv = `
  <style>
    #userscript-header a:first-of-type{
      margin-left: 5px;
    }
    #userscript-header a img{
      width: 20px;
      padding: 1px;
      box-sizing:border-box;
      position: relative;
      bottom: 2px;
      filter: contrast(1);
      transition: all 200ms;
    }
    #userscript-header a:hover img{
      padding: 0px;
      filter:  contrast(1.3);
    }
    #userscript-header a:hover{
      background: transparent !important;
            
    }
  </style>
  <h2 id="userscript-header">转至串流:
    <span>
      ${Object.entries(STREAM_SERVICES)
        .map(
          ([k, v]) =>
            `<a onclick="usr_onIconClick('${k}')" href="#" data-stream-key="${k}"><img src="${v.iconSrc}"/></a>`
        )
        .join("\n")}
    </span>
  </h2>`;
document.querySelector(".aside").insertAdjacentHTML("afterBegin", streamDiv);
const ALBUM = {
  title:
    document.querySelector("#wrapper").firstElementChild.firstElementChild
      .textContent,
  artist: "",
};
for (let e of document.querySelector("#info").children) {
  if (e?.textContent?.trim()?.startsWith("表演者:")) {
    ALBUM.artist = e.textContent
      .replace("表演者:", "")
      .replaceAll(/\s+/g, " ")
      .trim();
    break;
  }
}
console.log(ALBUM);
/** @type {(this: HTMLElement, ev: MouseEvent) => any} */
window.usr_onIconClick = function (key) {
  if (key) {
    window.open(
      STREAM_SERVICES[key].searchUrl.replace(
        "{{query}}",
        `${encodeURIComponent(ALBUM.title + " " + ALBUM.artist)}`
      )
    );
  }
};
